import React from 'react'
import { TeamData } from '../data/TeamData'
const Team = () => {
  return (
    <div>
      <header id="page-header">
        <div className="page-heading">
          <h2>Team</h2>

        </div>
      </header>

      {TeamData.map(item => {
        return (
          <div>{item.name}</div>
        )
      })}
    </div>
  )
}

export default Team
